Ingredientes:
• Harina 1 1/4 taza
• Leche o bebida vegetal 1/4 taza
• Yogurt natural 1/2 taza
• Aceite 1/2 taza
• Azúcar 1/2 taza
• Huevo 1 unidad
• Polvo de hornear 1 cdta
• Esencia de vainilla 1 cdta
• Sal 1 pizca
⠀
Procedimiento:
1. Precalentamos el horno a 180C.
2. En un bowl batimos el azúcar, huevo y aceite. Luego agregamos la leche, yogur y vainilla.
3. En otro bowl mezclamos los secos e incorporamos a los húmedos.
4. Colocar en molde previamente aceitado y horneamos por aproximadamente 20-25 mins.
⠀
